function constructor(props) {
  // super(props);
  this.state = {
    inputValue: '',
    list:[]
  }
}

function TodoList() {
  return (
    <div>
      <input  />
      <button>提交</button>
      <ul>
        <li>学英语</li>
        <li>Learning React</li>
      </ul>
    </div>
  );
}

export default TodoList;
